			var comm_levels_sql = 'DROP TABLE IF EXISTS default_sid_comm_level; CREATE TABLE IF NOT EXISTS default_sid_comm_level ( comm_level_id INTEGER PRIMARY KEY AUTOINCREMENT, comm_level_name varchar(255) ); INSERT INTO default_sid_comm_level(comm_level_id,comm_level_name) VALUES ("1",""); INSERT INTO default_sid_comm_level(comm_level_id,comm_level_name) VALUES ("2","EMERGING"); INSERT INTO default_sid_comm_level(comm_level_id,comm_level_name) VALUES ("3","FULL"); INSERT INTO default_sid_comm_level(comm_level_id,comm_level_name) VALUES ("5","LIMITED"); INSERT INTO default_sid_comm_level(comm_level_id,comm_level_name) VALUES ("8","PAST"); INSERT INTO default_sid_comm_level(comm_level_id,comm_level_name) VALUES ("9","ZERO");';
